        [Fact]
        public void NestedPolygon_ShouldHave_GeohashesIn_LargePolygon()
        {
            // Given a large encompassing rectangle
            Polygon largeRectangle = new Polygon(new LinearRing(new Coordinate[] {
                                        new Coordinate(-45, -45),
                                        new Coordinate(-45, 45),
                                        new Coordinate(45, 45),
                                        new Coordinate(45, -45),
                                        new Coordinate(-45, -45)
                                    }));

            // And a hasher for generating geohashes
            PolygonHasher hasher = new PolygonHasher();

            HashSet<string> originalGeohashes = hasher.GetHashes(largeRectangle, 6);

            // When we have a smaller nested rectangle
            Polygon smallRectangle = new Polygon(new LinearRing(new Coordinate[] {
                                        new Coordinate(44, 44),
                                        new Coordinate(44, 45),
                                        new Coordinate(45, 45),
                                        new Coordinate(45, 44),
                                        new Coordinate(44, 44)
                                    }));
            HashSet<string> smallRectangleGeohashes = hasher.GetHashes(smallRectangle, 6);

            // Then all geohashes of the smaller rectangle should be present in the geohashes of the large rectangle
            Assert.All(smallRectangleGeohashes, gh => Assert.Contains(gh, originalGeohashes));
        }

        [Fact]
        public void NestedPolygon_Precision2_ShouldHave_GeohashesIn_LargePolygon()
        {
            // Given a large encompassing rectangle
            Polygon largeRectangle = new Polygon(new LinearRing(new Coordinate[] {
                                                    new Coordinate(-70, -70),
                                                    new Coordinate(-70, 70),
                                                    new Coordinate(70, 70),
                                                    new Coordinate(70, -70),
                                                    new Coordinate(-70, -70)
                                                }));

            // And a hasher for generating geohashes
            PolygonHasher hasher = new PolygonHasher();

            HashSet<string> originalGeohashes = hasher.GetHashes(largeRectangle, 5);

            // When we have a smaller nested rectangle
            Polygon smallRectangle = new Polygon(new LinearRing(new Coordinate[] {
                                                    new Coordinate(68, 68),
                                                    new Coordinate(68, 69),
                                                    new Coordinate(69, 69),
                                                    new Coordinate(69, 68),
                                                    new Coordinate(68, 68)
                                                }));
            HashSet<string> smallRectangleGeohashes = hasher.GetHashes(smallRectangle, 2);

            // Then all geohashes of the smaller rectangle should be present in the geohashes of the large rectangle
            Assert.All(smallRectangleGeohashes, gh => Assert.Contains(gh, originalGeohashes));
        }


